'use strict';

const BaseUI = lacoLib('libs/ui/base');

class SemanticUIAdmin extends BaseUI {
    constructor(subapp, ui) {
        super(subapp, ui, {});

        this.discovery(err => {
            this.subapp.laco.emit(!err ? 'ui.SUIAdmin.loaded' : 'ui.SUIAdmin.error', err);
        });
    }
}

module.exports = SemanticUIAdmin;